import React from 'react';
import { Link, animateScroll as scroll } from "react-scroll";
import './Navbar.scss';

const Navbar = () => {

    return (
        <div className='NavbarContainer'>
            <Navbar className='Navbar'>
                <Link 
                    activeClass='active'
                    to='Home'
                    smooth={true}
                    offset={-70}
                    duration={500}
                >Home</Link>
            </Navbar>
        </div>
    );
}
export default Navbar;
